import React from 'react'

export default () => {

    const createcolumns = () => {
        return (
            <>
                <div className='1'> </div>
                <div className='2'> </div>
                <div className='3'> </div>
                <div className='4'> </div>
                <div className='5'> </div>
                <div className='6'> </div>
                <div className='7'> </div>
                <div className='8'> </div>
                <div className='9'> </div>
                <div className='10'> </div>
            </>
        )
    }

    const createrows = (rowNum) => {
        return ( <div className={rowNum}> {createcolumns()} </div> )
    }

    return (
        <div className='grid'>
            {createrows('row1')}
            {createrows('row2')}
            {createrows('row3')}
            {createrows('row4')}
            {createrows('row5')}
            {createrows('row6')}
            {createrows('row7')}
            {createrows('row8')}
            {createrows('row9')}
            {createrows('row10')}
        </div>
    )

}
